import React from 'react';
import Image from '../../assets/ball.jpg'

const Body = () => {
    return (
        <div class="card">
            <img src={Image} class="card-img-top"/>
            <div class="card-body">
                <p class="card-text">detail lapangan</p>
                <button>View</button>
                <button>Book</button>
            </div>
        </div>
    )
}

export default Body
